import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
// import App from './App';
import Home from "./components/Home"

import {
  BrowserRouter as Router,
  Routes,
  Route
} from "react-router-dom";

const App = () => {
  return(
    <>
      <Router>
        <div>
          <Routes>
            <Route path="/login">
              {/* <LoginPage /> */}
            </Route>
            <Route path="/register">
              {/* <RegisterPage /> */}
            </Route>
            <Route path="/">
              <Home />
            </Route>
          </Routes>
        </div>
      </Router>
    </>
  )
};

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
